import { useState, useEffect, useRef } from 'react';
import FusePageCarded from '@fuse/core/FusePageCarded';
import { useDispatch } from 'react-redux';
import { useParams } from 'react-router-dom';
import { styled } from '@mui/material/styles';
import AnalysisAppSidebarContent from './AnalysisAppSidebarContent';
import AnalysisAppSidebarHeader from './AnalysisAppSidebarHeader';
import Analysis from './analysis/Analysis';
import AnalysisContext from './Analysis-context/AnalysisContext';

const Root = styled(FusePageCarded)(({ theme }) => ({
  '& .FusePageCarded-contentWrapper': {
    padding: '0',
  },
  '& .FusePageCarded-header': {
    display: 'none',
  },
  '& .FusePageCarded-contentCard': {
    borderRadius: '20px 0 0 0',
  },
  '& .FusePageCarded-content': {
    display: 'flex',
    flexDirection: 'column',
  },
  '& .FusePageCarded-sidebar': {
    width: '290px',
  },
  '& .FusePageCarded-sidebarHeader': {
    minHeight: 100,
    height: 100,
    alignItems: 'center',
  },
}));

const rowHeight = 41;

function AnalysisPage(props) {
  const dispatch = useDispatch();

  const pageLayout = useRef(null);
  const routeParams = useParams();

  const [appFileContent, setAppFileContent] = useState([]);
  const [authorityAppFileContent, setAuthorityAppFileContent] = useState([]);
  const [authorityVehicleFileContent, setAuthorityVehicleFileContent] = useState([]);
  const [authorityAppFileContentName, setAuthorityAppFileContentName] = useState('');
  const [authorityVehicleFileContentName, setAuthorityVehicleFileContentName] = useState('');
  const [appFileContentName, setAppFileContentName] = useState('');
  const [authorityLength, setAuthorityLength] = useState(0);
  const [ownLength, setOwnLength] = useState(0);
  const [isAuthorityReady, setIsAuthorityReady] = useState(false);
  const [isOwnReady, setIsOwnReady] = useState(false);
  const [isauthorityCompanyReady, setAuthorityCompanyReady] = useState(false);

  const [mapChangedTimestamp, setMapChangedTimestamp] = useState(0);
  const [pathAppFile, setPathAppFile] = useState([]);
  const [pathAuthorityFile, setPathAthprityFile] = useState([]);

  const [availableHeight, setAvailableHeight] = useState(window.innerHeight - 401);

  useEffect(() => {
    window.addEventListener('resize', () => {
      setAvailableHeight(window.innerHeight - 401);
    });
  }, []);

  return (
    <AnalysisContext.Provider
      value={{
        setAppFileContent,
        setAuthorityAppFileContent,
        setAuthorityVehicleFileContent,
        setAuthorityAppFileContentName,
        setAuthorityVehicleFileContentName,
        setAppFileContentName,
        availableHeight,
        setAvailableHeight,
        authorityLength,
        setAuthorityLength,
        ownLength,
        setOwnLength,
        isAuthorityReady,
        setIsAuthorityReady,
        isOwnReady,
        setIsOwnReady,
        isauthorityCompanyReady,
        setAuthorityCompanyReady,
        mapChangedTimestamp,
        setMapChangedTimestamp,
        pathAppFile,
        setPathAppFile,
        pathAuthorityFile,
        setPathAthprityFile,
        appFileContent,
        authorityAppFileContent,
        authorityVehicleFileContent,
        authorityAppFileContentName,
        authorityVehicleFileContentName,
        appFileContentName,
        rowHeight,
      }}
    >
      <Root
        content={<Analysis {...{ pageLayout }} />}
        leftSidebarHeader={<AnalysisAppSidebarHeader />}
        leftSidebarContent={<AnalysisAppSidebarContent />}
        ref={pageLayout}
        innerScroll
      />
    </AnalysisContext.Provider>
  );
}

export default AnalysisPage;
